(NULL, 'ΑΛΕΞ ΦΕΡΓΚΙΟΥΣΟΝ', '1941-12-31', 'Είναι πρώην ποδοσφαιριστής και ένας από τους πιο πετυχημένους προπονητές ποδοσφαίρου. Έχει συνδεθεί όσο κανείς με την Μάντσεστερ Γιουνάιτεντ στην οποία είναι προπονητής από το 1986 και έχει κατακτήσει περισσότερα τρόπαια από οποιονδήποτε άλλο προπονητή στην ιστορία του αγγλικού ποδοσφαίρου.', 96, 23, 56, NULL);
